(73618, 7247, 6654, 7, '我擁抱的是一路裝作勇敢的你', '3月26日\n昨晚進到立院裡，唱歌陪伴學生，\n唱著陪著他們每一天寫下的歌，\n唯獨缺一首，\n可以陪他們休息的晚安曲，\n老天爺幫了忙，\n這首歌來了。\n『我想擁抱的 是一路裝作勇敢的你』太陽花民歌七號 誕生', '2014-03-25 00:00:00', 2014, 20, 0, 6, '我想擁抱的   是一路裝作勇敢的你    \n太陽花民歌七號\n詞曲：黃建為\n\n當世界都睡了 我沒想到是你 \n披上了件風衣 就這樣狂奔而去\n\n而世界還是黑的 我就這樣望著你 \n用生命的炙熱 燃燒一絲光明\n\n於是我看到了  你溫柔的心  \n他用力的跳動著  還有倔強的脾氣\n\n我害怕著失去你  才望著你的背影 \n我擁抱的是    一路裝作勇敢的你\n\n我等待的是風起  祈禱的是和平\n我愛上的是  獨自站在黑暗中的你\n\n當快樂都不見了  我們能去哪裡\n再漂泊的靈魂   還是想找到安寧\n\n當夢想都實現了  我默默望著你\n為什麼還是有一種  寂寞的表情\n  \n於是我看到了  你溫柔的心   \n他固執的跳動著  還有倔強的脾氣\n\n我害怕著失去你  才望著你的背影 \n我擁抱的是    一路裝作勇敢的你\n\n我等待的是風起  我祈禱的是和平\n我愛上的是  你眼裡閃爍的風景\n\n我害怕著失去你  才望著你的背影 \n我擁抱的是    一路裝作勇敢的你\n\n我等待的是風起  我祈禱的是和平\n我愛上的是  獨自站在黑暗中的你\n\n我捨不得的是你從不願落下的淚滴\n', '', 242, '', '黃建為', '黃建為', '黃建為', '黃建為', '', 1, 1, 0, '2014-03-27 00:04:08', '2015-03-12 14:05:50', '0000-00-00 00:00:00'),
