(73646, 10465, 0, 1, '假裝沉默', '', '2014-03-28 00:00:00', 2000, 19, 2, 1, '身陷叢林中 使我在顫抖\n聽見心臟跳動 震耳欲聾 \n樹影的晃動 是月光操弄\n人們就像玩偶 被生活操作\n身陷泥沼中 該如何掙脫\n不想繼續墬落 繼續惶恐\n是該擺脫  身上的枷鎖\n縱使失望難過 \n雖然說\n\n社會道德感低落 \n使純淨靈魂剝落\n失去善良自我\n正義感失蹤 \n只有富人能教唆\n沒有英不英雄\n\noh 飛蛾撲火\n我說  懦(弱)夫的藉口   振作\n逃出現實的壓迫\noh 別再退縮\n鼓起勇氣戰鬥', '', 272, '', '', '', '', '幻雨', '', 0, 1, 1, '2014-03-28 04:33:08', '2014-06-22 01:58:28', '2014-06-22 01:58:28'),
(73647, 156879, 6607, 4, 'Revolution', '', '2014-03-28 00:00:00', 2000, 19, 0, 4, 'Revolution               詞曲 陳彥允\n\nA\n我看著你的側臉 覺得有點可笑\n雷霆萬鈞的氣勢 嚇得你想落跑\n風度翩翩的我 脫下了紳士帽\n用我神秘的氣息 寫下了驚嘆號\n\nB\n笑 不笑 都不重要\n重要的是 你別再 庸人自擾\n在這邪惡世界 你我都自身難保\n我用絕對的武力 殺出我的王道\n\nC\nRe Re Re Re Revolution 反抗著地球引力\nRe Re Re Re Revolution 留下了我的足跡\nRe Re Re Re Revolution 對世界展開革命\nRe Re Re Re Revolution 進化了我的生命\n\n2A\nRevolution 我開始挑戰 世俗規矩\n對這個假惺惺的人類文明 開始革命\n血液裡 留著叛逆 用我的絕對舞力 貫徹心中的正義\n\n2B\nAre you ready? Follow me \nCome to join my whole new city\nBaby baby come with me\nCome to join my revolution\n\n2C\nRe Re Re Re Revolution 反抗著地球引力\nRe Re Re Re Revolution 留下了我的足跡\nRe Re Re Re Revolution 對世界展開革命\nRe Re Re Re Revolution 進化了我的生命\n\nD\n花與蝶 風和雨 天和地 我和你\n緊密的連繫 是否那就是愛情\n髒空氣 爛規矩 最愛用嘴巴放屁\n對他們來說 多數是否就代表正義\n\n我擁有 絕不妥協的定力 生命最初的原動力\n做我的兄弟 絕對夠給力\nHa Ha 我的命運 由我親手執筆\n整裝待發 準備出發\n\n3C\nRe Re Re Re Revolution 反抗著地球引力\nRe Re Re Re Revolution 留下了我的足跡\nRe Re Re Re Revolution 對世界展開革命\nRe Re Re Re RRevolution               詞曲 陳彥允\n\nA\n我看著你的側臉 覺得有點可笑\n雷霆萬鈞的氣勢 嚇得你想落跑\n風度翩翩的我 脫下了紳士帽\n用我神秘的氣息 寫下了驚嘆號\n\nB\n笑 不笑 都不重要\n重要的是 你別再 庸人自擾\n在這邪惡世界 你我都自身難保\n我用絕對的武力 殺出我的王道\n\nC\nRe Re Re Re Revolution 反抗著地球引力\nRe Re Re Re Revolution 留下了我的足跡\nRe Re Re Re Revolution 對世界展開革命\nRe Re Re Re Revolution 進化了我的生命\n\n2A\nRevolution 我開始挑戰 世俗規矩\n對這個假惺惺的人類文明 開始革命\n血液裡 留著叛逆 用我的絕對舞力 貫徹心中的正義\n\n2B\nAre you ready? Follow me \nCome to join my whole new city\nBaby baby come with me\nCome to join my revolution\n\n2C\nRe Re Re Re Revolution 反抗著地球引力\nRe Re Re Re Revolution 留下了我的足跡\nRe Re Re Re Revolution 對世界展開革命\nRe Re Re Re Revolution 進化了我的生命\n\nD\n花與蝶 風和雨 天和地 我和你\n緊密的連繫 是否那就是愛情\n髒空氣 爛規矩 最愛用嘴巴放屁\n對他們來說 多數是否就代表正義\n\n我擁有 絕不妥協的定力 生命最初的原動力\n做我的兄弟 絕對夠給力\nHa Ha 我的命運 由我親手執筆\n整裝待發 準備出發\n\n3C\nRe Re Re Re Revolution 反抗著地球引力\nRe Re Re Re Revolution 留下了我的足跡\nRe Re Re Re Revolution 對世界展開革命\nRe Re Re Re Revolution 進化了我的生命\n\nevolution 進化了我的生命\n', '', 181, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-03-28 14:10:22', '2015-03-12 14:05:51', '0000-00-00 00:00:0