(73648, 156879, 6607, 5, 'Song About You', '', '2014-03-28 00:00:00', 2000, 19, 0, 4, 'Song About Love 關於愛的歌   詞曲 李玉璽\n\nA1\nOpen your eyes 睜開雙眼\ntell me your story 告訴我 你的故事\nI see the memories 我看見 那些記憶\ncoming down from your tears 從你眼中滑落\n\nA2\nDid your eyes smile or it was sorrow \n你眼中 是微笑嗎？或者那是傷悲？\nI can''t tell when you look at other side\n我不得而知 當你看著遠方\n\nB1\nI know what makes you cry 你哭泣的原因 我明白\ncause you did the same to me 因為你讓我經歷了 相同的事情\n\nC\nSee, Look at me 看著我\nI was here every time you need  \n當你需要我的時候 我會在你身邊\nBut you never thought of me yea 但你從未想到過我 耶\n\nD\nWhat makes me so weak 是什麼 讓我如此脆弱\nI think is something called love 我想 那就是「愛」吧\n\n2A1\nTurn on your life. Start up your story \n你開啓了新的人生 開始新的故事\nI see the step of your leaving 我看見你 離去的步伐\nand you are with him 而你 和他在一起\n\n2A2\nDid my eyes smile or it was sorrow \n我的眼神 是微笑嗎？或者這是傷悲？\nI can''t tell. When your laughter is not with me \n我不得而知 當你的笑容 不是來自於我\n\n2B\nI know what makes you smile 你微笑的原因 我明白\nCause you did the same to me 因為你讓我經歷了 相同的事情\nOh~ you did the same to me 喔 你讓我經歷了 相同的事情\n', '', 244, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-03-28 14:13:47', '2015-03-12 14:05:51', '0000-00-00 00:00:00'),
