(73650, 14741, 0, 1, 'Na Demelja La Jalan－光明的道路－排灣語', '擔心著未來的路  該怎麼走...\n其實只要抬頭看看\n並不是只有孤獨陪伴著\n\n不要害怕，勇敢的走！\n其實路就在眼前\n走就對了！', '2014-04-02 00:00:00', 2000, 19, 2, 1, '太陽跟我說：\n" 照亮的大地，就是我給你的道路。不要害怕！我會在上頭守護著你，這是我給你的力量！"\n\n月亮跟我說：\n" 照亮的大地，就是我給你的道路。不要害怕！有我牽引著你，是我給你的智慧！"\n\n阿伊～～  這是光明的道路！不要害怕！\n阿伊～～  這是光明的道路！不要害怕！\n\n祖先唱著歌\n那悠揚的歌聲，是給我的保護。不要害怕！那是祖先的牽扶著我。不管到哪裡，我都已獲得勇氣！\n\n阿伊～～  這是光明的道路！不要害怕！\n阿伊～～  這是光明的道路！不要害怕！\n阿伊～～  這是光明的道路！不要害怕！\n阿伊～～  這是光明的道路！不要害怕！\n（伊伊～～  太陽跟我說：不要害怕！）\n（伊伊～～  月亮跟我說：不要害怕！）\n\n祖先們用彩虹編織著衣服，這七彩的衣服你就穿著長大吧！\n祖先說：\n" 那衣服上的圖騰，就是我給你的記號與叮嚀啊！', '', 371, '', '巴賴', '巴賴', '巴賴', '巴賴 （高仲杰）', '', 0, 1, 1, '2014-03-28 16:27:41', '2014-06-23 23:12:37', '2014-06-23 23:12:37'),
(73651, 7247, 0, 1, '追  太陽花民歌九號', '', '2013-03-28 00:00:00', 2014, 19, 1, 7, '追 \n\n\n\n怎麼了這世界\n\n黑色的窗簾\n\n瞞住了美麗的春天\n\n\n\n誰弄花了你的臉\n\n紅色的妝顏      \n\n忍耐我的心痛\n\n也不願心碎\n\n\n\n望著你把青春都浪費\n\n只為一分為人的尊嚴\n\n\n\n啊你若是蝴蝶  我追隨\n\n在無邊的草原裡  自由飛\n\n你若選做狂風  我願是火\n\n伴你一生揮霍執著\n\n\n\n你若是鴿子  我追隨\n\n在無邊的天空  自由飛\n\n你若選做狂風  我願是火\n\n伴你一生揮霍執著', '', 251, '', '', '', '', '黃建為', '', 0, 0, 1, '2014-03-28 16:34:33', '2014-03-28 16:35:58', '2014-03-28 16:35:58'),
(73652, 7247, 6654, 8, '追', '若雨生哥..還在..就好了\n這首 追......若他來唱....我們的心，都會因此堅強百倍\n我願意，追隨你，\n追隨著你，自由而開闊的心   \n\n你若是蝴蝶  我追隨\n在無邊的草原裡  自由飛\n你若選做狂風  我願是火\n伴你一生揮霍執著\n                                                 建為 3月28日\n\n', '2014-03-28 00:00:00', 2014, 20, 0, 6, '追 \n\n怎麼了這世界\n\n黑色的窗簾\n\n瞞住了美麗的春天\n\n\n\n誰弄花了你的臉\n\n紅色的妝顏      \n\n忍耐我的心痛\n\n也不願心碎\n\n\n\n望著你把青春都浪費\n\n只為一分為人的尊嚴\n\n\n\n啊你若是蝴蝶  我追隨\n\n在無邊的草原裡  自由飛\n\n你若選做狂風  我願是火\n\n伴你一生揮霍執著\n\n\n\n你若是鴿子  我追隨\n\n在無邊的天空  自由飛\n\n你若選做狂風  我願是火\n\n伴你一生揮霍執著', '', 251, '', '黃建為', '黃建為', '黃建為', '黃建為', '', 1, 1, 0, '2014-03-28 16:36:37', '2015-03-12 14:05:52', '0000-00-00 00:00:00'),
(73653, 188493, 0, 1, '李賢璞說', '這是我在2/27送給八三夭阿璞的歌\n後來還被轉貼了  非常開心~\n錄的沒有很好\n而且設備爛\n\n我沒有很好的設備，但我有一顆無比感謝的心。\n謝謝八三夭，長久以來支撐著我的靈魂。', '2014-02-27 00:00:00', 2000, 19, 2, 5, '\n未來的那個你是否活的過癮   \n比現在這個我更喜歡那個自己\n努力    達到理想自己\n\n應該厚著臉皮活在他們期許   \n還是硬著頭皮開始做自己\n不該懷疑    勇敢相信自己\n\n李賢璞說  絕不要放棄\n不要辜負此刻自己\n李賢璞說  堅持夢想到底\n熱血巴士永不停熄\n\n接下來唱到了鋼鐵生命 \n 你我都是彼此的熊麻吉\n李嘉誠說了許多大道理\n拜託李賢璞也   要我們無愧自己\n\n拯救世界雖然不容易   \n就算凡人也能堅持到底\n相信夢想會有結局  努力做到八月三十一\n\n李賢璞唱  那麼多歌曲\n這哪算是很容易\n李賢璞寫  許多動人驚心\n讓許多人生命有意義\n\n李賢璞說  絕不要放棄\n不要辜負此刻自己\n李賢璞說  用鋼鐵信念堅持自己\n一起創造輝煌的回憶\n我知道我用盡全力  未來就會無愧我心', '', 154, '', '蕭綺慧', '蕭綺慧', '蕭綺慧', '蕭綺慧', '', 0, 1, 0, '2014-03-28 22:33:19', '2015-03-12 14:05:52', '0000-00-00 00:00:00'),
