(73657, 211027, 0, 1, '說書人(DEMO)', '', '2014-03-29 00:00:00', 2000, 19, 1, 7, '*讓我說 \n我要的是甚麼　不再安靜沉默\n即使難走　不再是只有我\n你是否\n也有故事要說　也有夢想要衝\n不要退後　讓我們替你說*\n\n多少人在這\n午夜時分驚醒過後\n又是一場折磨\n封閉在孤獨的牢籠\n沒有出口\n心中所想雜陳五味\n傳不出這世界\n提起筆墨振筆書寫\n你會聽見\n\n曾想過\n每個笑容 溫柔　每個勝利 執著\n都有故事　穿梭在每個巷弄\n也看過\n每次悲傷 懦弱　每次失敗 過錯\n也有故事　顫抖在每個角落\n\n你以為\n會有人試著　了解你\n你他媽耍自閉　沒有人會同情\n所以　喊出口\n所有在你 心中　所有感受 要說\n別再沉默　讓全世界聽見', '', 247, '', '', '', '', '說書人樂團', '', 0, 1, 0, '2014-03-29 02:29:43', '2015-03-12 14:05:52', '0000-00-00 00:00:00'),
(73658, 164864, 6576, 8, 'No28.守護台灣', '', '2014-02-25 00:00:00', 2000, 19, 0, 4, '你是被深深傷害過 \n還是無言地被挽留\n為何臉上的表情\n總是有一點哀愁\n\n握你的手\n總是感到一絲寒冷的雪\n路走到盡頭\n才發現一切的一切都沒有用\n\n是否在對我說\n是否你要靜靜（輕輕）地離開我\n在對我說\n我們曾經有的那段烈火\n下一個寒冬\n你說也許不會再見面啦\n怎麼形容\n有些事情不是當下就能懂\n\n', '', 181, '', '', '', '', '黃藍白', '', 0, 1, 0, '2014-03-29 12:12:02', '2015-03-12 14:05:52', '0000-00-00 00:00:00'),
(73659, 169817, 0, 1, '巨獸', '', '2013-03-29 00:00:00', 2000, 19, 1, 1, '詞／曲：翁資閔\n\n我看見黑暗\n從他們口袋中掉落的貪婪\n我看見摧殘\n摧殘這寶貴自由的腐敗\n\n嘿 站起來\nI see the fight\n\n道德被巨獸摧毀 我們向自主道別\n那張貪婪的嘴臉 宣示誰的主權\n得來不易的自由 不應被輕易浪費\n我們只是要多元 給更好的明天\n\n把門打開\n聽聽所遺漏的社會的空白\n我們要勇敢\n不要被專一龐大的勢力打敗\n\n嘿 站起來 \nI see the light', '', 239, '', '', '', '', '白袍與聽診器', '', 1, 1, 0, '2014-03-29 13:48:54', '2015-03-12 14:05:52', '0000-00-00 00:00:00'),
